let para = <p>
Lorem ipsum, dolor sit amet consectetur adipisicing elit. 
Architecto ut consequatur similique, necessitatibus iusto ad tenetur numquam sint. 
Nesciunt commodi, ullam iusto, illo vitae eligendi, aspernatur molestiae eaque 
repudiandae adipisci sit necessitatibus officiis incidunt.";
</p>

function App() {
  return (
    <>
      <nav>
        <li>Home</li>
        <li>About</li>
        <li>contact</li>
        <li>Login</li>
      </nav>
      <div>
      {para}
      </div>
    </>
  );
}

export default App;
